import { Box, Image, Title, Subtitle } from 'bloomer';

export default function Details() {
    const style = {
        marginLeft: 'auto', 
        marginRight: 'auto',
        padding: 10,
        border: '0.1rem solid black', 
        borderRadius: '50%'
    }
    return (
        <Box hasTextAlign='centered'>
            <Image style={style} isSize='128x128' src='https://i.pravatar.cc/150?img=14' />
            <Title>Fulano de Tal</Title>
            <Subtitle isSize={5}>Musculação</Subtitle>
        </Box>
    );
}
